(function(){var loadHandler=window['sl_{18DE6108-0EA5-469B-9224-CABD79A3332F}'];loadHandler&&loadHandler(1, '<div id="spr0_9967762"><div id="spr1_9967762" class="kern slide"><img id="img8_9967762" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/><div id="spr3_9967762" style="left:986.15px;top:648.5px;"><div id="spr4_9967762"><img id="img0_9967762" src="data:image/png;base64," width="273.75" height="62.25" alt="" style="left:0.06px;top:-0.094px;"/></div></div></div><div id="spr2_9967762" class="kern slide"><div id="svg0_9967762" style="left:1066.677px;top:666.367px;"><svg width="187" height="38" viewBox="0 0 187 38"><path fill="#c6baec" d="M0,0 h186.656 v37.44 h-186.656 Z"/></svg></div><div id="spr5_9967762" style="left:1066.677px;top:666.367px;"><div style="width:0px;"><span id="txt0_9967762" class="nokern relpos" data-width="75.858070" style="left:18.578px;top:1.931px;">Book D  </span> <span id="txt1_9967762" class="nokern relpos" data-width="73.511719" style="left:18.572px;top:1.931px;">Page 17</span></div></div><div id="svg1_9967762" style="left:84.039px;top:35.42px;"><svg width="640" height="228" viewBox="0 0 640 228"><path fill="#ffffff" d="M0,0 h639.161 v227.958 h-639.161 Z"/></svg></div><div id="spr6_9967762" style="left:84.039px;top:35.42px;"><div style="width:0px;"><span id="txt2_9967762" class="nokern" data-width="335.929688" style="left:9.6px;top:3.527px;">3. Predator Prey Relationship:</span></div><div style="width:0px;"><span id="txt3_9967762" class="nokern relpos" dir="auto" style="left:9.6px;top:39.998px;">•</span> <span id="txt4_9967762" class="nokern relpos" data-width="485.197266" style="left:31.664px;top:36.429px;">Interactions that tends to keep populations from</span></div><div style="width:0px;"><span id="txt5_9967762" class="nokern" data-width="332.584625" style="left:39.6px;top:67.435px;">exceeding their carrying capacity.</span></div><div style="width:0px;"><span id="txt6_9967762" class="nokern relpos" dir="auto" style="left:9.6px;top:102.011px;">•</span> <span id="txt7_9967762" class="nokern relpos" data-width="365.223297" style="left:31.664px;top:98.442px;">Fluctuations in the prey populations </span> <span id="txt8_9967762" class="nokern relpos" data-width="56.486042" style="left:31.658px;top:98.442px;">may </span> <span id="txt9_9967762" class="nokern relpos" data-width="56.301430" style="left:31.651px;top:98.442px;">cause</span></div><div style="width:0px;"><span id="txt10_9967762" class="nokern" data-width="402.709625" style="left:39.6px;top:129.449px;">fluctuations in the predator populations.</span></div><div style="width:0px;"><span id="txt11_9967762" class="nokern relpos" dir="auto" style="left:9.6px;top:164.025px;">•</span> <span id="txt12_9967762" class="nokern relpos" data-width="502.119781" style="left:31.664px;top:160.455px;">A classic example of this is the snowshoe hare and</span></div><div style="width:0px;"><span id="txt13_9967762" class="nokern" data-width="275.032532" style="left:39.6px;top:191.462px;">lynx populations in Canada.</span></div></div><div id="spr7_9967762" style="left:749.357px;top:10.86px;"><div id="spr8_9967762"><img id="img1_9967762" src="data:image/png;base64," width="437.25" height="288.75" alt="" style="left:0.022px;top:-0.028px;"/></div></div><div id="spr9_9967762" style="left:89.6px;top:309.955px;"><div style="width:0px;"><span id="txt14_9967762" class="nokern" data-width="855.710938" style="left:9.6px;top:3.595px;">In order to avoid their predators, many prey/plant species have developed specialized</span></div><div style="width:0px;"><span id="txt15_9967762" class="nokern relpos" data-width="226.312500" style="left:9.6px;top:34.602px;">defense mechanisms </span> <span id="txt16_9967762" class="nokern relpos" data-width="602.559204" style="left:9.593px;top:34.602px;">that allow them to better avoid being consumed. The role of</span></div><div style="width:0px;"><span id="txt17_9967762" class="nokern" data-width="779.089172" style="left:9.6px;top:65.609px;">defense mechanisms in predation and competition includes examples such as:</span></div></div><div id="spr10_9967762" style="left:89.6px;top:309.955px;"><div style="width:0px;"><span id="txt18_9967762" class="nokern relpos" dir="auto" style="left:9.6px;top:108.185px;">•</span> <span id="txt19_9967762" class="nokern relpos" data-width="399.477844" style="left:31.664px;top:104.615px;">Plants defend themselves by producing </span> <span id="txt20_9967762" class="nokern relpos" data-width="65.321609" style="left:31.658px;top:104.615px;">toxins</span> <span id="txt21_9967762" class="nokern relpos" data-width="11.123047" style="left:31.651px;top:104.615px;">, </span> <span id="txt22_9967762" class="nokern relpos" data-width="69.029297" style="left:31.644px;top:104.615px;">thorns</span> <span id="txt23_9967762" class="nokern relpos" data-width="46.041664" style="left:31.638px;top:104.615px;">, etc.</span></div></div><div id="spr11_9967762" style="left:89.6px;top:309.955px;"><div style="width:0px;"><span id="txt24_9967762" class="nokern relpos" dir="auto" style="left:9.6px;top:147.191px;">•</span> <span id="txt25_9967762" class="nokern relpos" data-width="137.877975" style="left:31.664px;top:143.622px;">Camouflage: </span> <span id="txt26_9967762" class="nokern relpos" data-width="675.716797" style="left:31.658px;top:143.622px;">Adaptations in form, shape or behaviour that better enables prey to</span></div><div style="width:0px;"><span id="txt27_9967762" class="nokern relpos" data-width="520.414673" style="left:39.6px;top:174.629px;">blend in with the surroundings to avoid predation. E</span> <span id="txt28_9967762" class="nokern relpos" data-width="275.969757" style="left:39.593px;top:174.629px;">x. spotted brown deer fawn,</span></div><div style="width:0px;"><span id="txt29_9967762" class="nokern" data-width="180.300491" style="left:39.6px;top:205.635px;">stripes on a tiger..</span></div></div><div id="spr12_9967762" style="left:89.6px;top:309.955px;"><div style="width:0px;"><span id="txt30_9967762" class="nokern relpos" dir="auto" style="left:9.6px;top:248.211px;">•</span> <span id="txt31_9967762" class="nokern relpos" data-width="97.336960" style="left:31.664px;top:244.642px;">Mimicry: </span> <span id="txt32_9967762" class="nokern relpos" data-width="743.119141" style="left:31.658px;top:244.642px;">Similar colour pattern or behavior of another organism to avoid predation.</span></div></div><div id="spr13_9967762" style="left:89.6px;top:309.955px;"><div style="width:0px;"><span id="txt33_9967762" class="nokern relpos" data-width="24.835938" style="left:9.6px;top:276.982px;">    </span> <span id="txt34_9967762" class="nokern relpos" data-width="15.273438" style="left:80.26px;top:276.982px;">- </span> <span id="txt35_9967762" class="nokern relpos" data-width="726.049194" style="left:80.253px;top:276.982px;">Ex. non-poisonous scarlet king snake resembles the poisonous coral snake</span> <span id="txt36_9967762" class="nokern relpos" style="left:80.247px;top:276.982px;">.</span></div></div><div id="spr14_9967762" style="left:89.6px;top:309.955px;"><div style="width:0px;"><span id="txt37_9967762" class="nokern" data-width="560.509460" style="left:105.6px;top:309.322px;">- Ex. Viceroy butterfly’s wing colour resembles monarchs.</span></div></div><div id="spr15_9967762" aria-label="Amazing Plant Defense Mechanisms (Types &amp; Examples) - Nature Roamer" role="group" style="left:715.481px;top:97.935px;"><div id="spr16_9967762"><img id="img2_9967762" src="data:image/jpeg;base64," width="302.25" height="201.75" alt="" style="left:0.056px;top:-0.056px;"/></div></div><div id="spr17_9967762" aria-label="Information About Sap In Trees | Gardening Know How" role="group" style="left:939.438px;top:35.42px;"><div id="spr18_9967762"><img id="img3_9967762" src="data:image/jpeg;base64," width="268.5" height="201.75" alt="" style="left:0.112px;top:-0.056px;"/></div></div><div id="spr19_9967762" style="left:709.323px;top:133.487px;"><div id="spr20_9967762"><img id="img4_9967762" src="data:image/jpeg;base64," width="307.5" height="157.5" alt="" style="left:-0.112px;top:-0.075px;"/></div></div><div id="spr21_9967762" style="left:964.267px;top:12.267px;"><div id="spr22_9967762"><img id="img5_9967762" src="data:image/jpeg;base64," width="307.5" height="175.5" alt="" style="left:-0.112px;top:0.039px;"/></div></div><div id="spr23_9967762" style="left:739.83px;top:31.079px;"><div id="spr24_9967762"><div id="spr25_9967762"><img id="img6_9967762" src="data:image/jpeg;base64," width="409.5" height="238.5" alt="" style="left:0.035px;top:0.111px;"/></div></div><div id="svg2_9967762" style="left:26.339px;top:194.194px;"><svg width="217" height="62" viewBox="0 0 217 62"><path fill="#ffffff" d="M0,0 h216.576 v61.394 h-216.576 Z"/></svg></div><div id="spr26_9967762" style="left:26.339px;top:194.194px;"><div style="width:0px;"><span id="txt38_9967762" class="nokern" data-width="193.260422" style="left:11.705px;top:5.883px;">Scarlet King Snake</span></div><div style="width:0px;"><span id="txt39_9967762" class="nokern" data-width="155.333344" style="left:30.625px;top:31.483px;">(non-venomous)</span></div></div><div id="svg3_9967762" style="left:263.194px;top:5.235px;"><svg width="236" height="62" viewBox="0 0 236 62"><path fill="#ffffff" d="M0,0 h235.992 v61.394 h-235.992 Z"/></svg></div><div id="spr27_9967762" style="left:263.194px;top:5.235px;"><div style="width:0px;"><span id="txt40_9967762" class="nokern" data-width="207.500000" style="left:14.33px;top:5.883px;">Eastern Coral Snake</span></div><div style="width:0px;"><span id="txt41_9967762" class="nokern" data-width="112.635422" style="left:61.663px;top:31.483px;">(venomous)</span></div></div></div><div id="spr28_9967762" style="left:720.235px;top:25.845px;"><div id="spr29_9967762"><div id="spr30_9967762"><img id="img7_9967762" src="data:image/png;base64," width="483" height="199.5" alt="" style="left:-0.07px;top:-0.038px;"/></div></div><div id="svg4_9967762" style="left:10.674px;top:186.768px;"><svg width="223" height="62" viewBox="0 0 223 62"><path fill="#ffffff" d="M0,0 h222.681 v61.394 h-222.681 Z"/></svg></div><div id="spr31_9967762" style="left:10.674px;top:186.768px;"><div style="width:0px;"><span id="txt42_9967762" class="nokern" data-width="168.343750" style="left:27.09px;top:5.883px;">Viceroy butterfly</span></div><div style="width:0px;"><span id="txt43_9967762" class="nokern" data-width="105.479172" style="left:58.51px;top:31.483px;">(the mimic)</span></div></div><div id="svg5_9967762" style="left:278.111px;top:187.869px;"><svg width="205" height="62" viewBox="0 0 205 62"><path fill="#ffffff" d="M0,0 h204.573 v61.394 h-204.573 Z"/></svg></div><div id="spr32_9967762" style="left:278.111px;top:187.869px;"><div style="width:0px;"><span id="txt44_9967762" class="nokern" data-width="180.156250" style="left:12.12px;top:5.883px;">Monarch butterfly</span></div><div style="width:0px;"><span id="txt45_9967762" class="nokern" data-width="107.895836" style="left:48.286px;top:31.483px;">(the model)</span></div></div></div><div id="spr33_9967762" style="left:1223.841px;top:3.386px;"><div id="svg6_9967762" style="left:4.59px;top:1.636px;"><svg width="47" height="28" viewBox="0 0 47 28"><path fill="#c00000" d="M0,0 h46.08 v27.429 h-46.08 Z"/></svg></div><div id="svg7_9967762" style="left:0px;top:0px;"><svg width="56" height="32" viewBox="0 0 56 32"><path fill="none" d="M0,0 h55.259 v31.5 h-55.259 Z"/></svg></div><div id="spr34_9967762"><div style="width:0px;"><span id="txt46_9967762" class="nokern" data-width="42.155083" style="left:9.598px;top:0.163px;">END</span></div></div></div></div></div>', '{"s":[]}');})();